import React from 'react'

export default function Navbar() {
    const navbarStyles = {
        color: "#091133", 
        display: 'flex',
    }
    const navPagesStyles = {
        display: 'flex'
    }
    return (
        <div>
            <nav className="navbar" style={navbarStyles}>
                <h2>BarIQ</h2>
                <div className="navPages" style={navPagesStyles}>
                    <p>Home</p>
                    <p>Layout</p>
                    <p>ROI</p>
                    <p>Help</p>
                </div>
                <button>Buy Now</button>
            </nav>
        </div>
    )
}
